script: |
  super -f text -I q9207.spq | sort > q9207.out

inputs:
  - name: q9207.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE - col2 * + col1 NOT BETWEEN col0 * - col1 - col2 / - col2 AND - col1 + col1;
  - name: tab1

outputs:
  - name: q9207.out
    data: |
      3	26	54
      80	13	96
